import React, { Component } from 'react';
import './App.css';
import DataList from './../dataList'


class First extends Component {
  constructor (props) {
    super(props)
    this.state = {
      response: '',
      post: '',
      responseToPost: '',
      keyword: ''
    }
  }

  componentWillMount () {
    this.props.getCurrentCity()
  }

  componentWillReceiveProps (nextProps) {
    if (nextProps.location.city) this.setState({ keyword: nextProps.location.city })
  }

  handleInputChange = (e) => {
    this.setState({ keyword: e.target.value })
  }

  search = () => {
    this.props.mainSearch(this.state.keyword)
    console.log('click!!!!')
  }

  submit = () => {
    this.props.mainSearch(this.state.keyword)
    console.log('click!!!!')
  }

  _handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      console.log('do validate');
    }
  }

  render() {
    console.log('JK', this.props.location)
    console.log('JK', this.state.keyword)
    return (
      <div className="App">
        <header className="App-header">
        เที่ยวไหนถูกดี?
        </header>
        <div className='App-body'>
          <div className='first_topic'>
            ใส่งบประมาณ หรือ ชื่อประเทศที่อยากเที่ยว
          </div>
          <div className='first_topic'>
            {
              this.props.location.city ? `คุณอยู่ ${this.props.location.city}`: ''
            }
          </div>
          <div>
            {/* <DataList
              id='input-search'
              option={[1,'Bangkok',3,4,5,6,7,8,9,10]}
              styleContainer={'st-datalist-container-car'}
              styleInput={'search-input'}
              placeholder='ระบุงบประมาณ หรือ ชื่อประเทศ'
              value={this.state.keyword}
              onInputChange={this.handleInputChange.bind(this)}
              /> */}
            <input
            type="text"
            className={'search-input'}
            placeholder='ระบุงบประมาณ หรือ ชื่อประเทศ'
            value={this.state.keyword}
            onChange={this.handleInputChange.bind(this)}
            onKeyPress={this._handleKeyPress}
            />
          </div>
          <div>
            <button onClick={this.search.bind(this)} >
            หาเลย
            </button>
            <button onClick={this.submit.bind(this)} >
            หาเลย2
            </button>
          </div>
          <div>
            {this.props.first.result ? (
              'Hello'
            ) : '' }
          </div>
        </div>
        <div>
        </div>
      </div>
    );
  }
}

export default First;
